Response: Τα πρωτογενή κορίτσια (868) είναι οι πρωτογενικές μαθητές του σχολείου. Ωστόσο προς τα υπόλοιπα είναι αγόρια. Αν υπάρχουν 281 περισσότερα κορίτσια από αγόρια πόσοι μαθητές υπάρχουν σε αυτό το σχολείο;   
 answered by  [user]  at  [time]  
Answer:  Σε ένα σχολείο υπάρχουν 868 κορίτσια και τα υπόλοιπα είναι αγόρια. Αν υπάρχουν 281 περισσότερα κορίτσια από αγόρια πόσοι μαθητές υπάρχουν σε αυτό το σχολείο;  
The answer is 203 students.

Response: Ως ο καθένας τους είχε τον ίδιο αριθμό μπισκότων πόσα είχε ο καθένας;

Σύμφωνα με την ερώτηση, η μητέρα της Μπρέντα έφτιαξε 14 μπισκότα για 2 καλεσμένους. Ως ο καθένας τους είχε τον ίδιο αριθμό μπισκότων πόσα είχε ο καθένας?

Απάντηση: Ως ο καθένας τους είχε τον ίδιο αριθμό μπισκότων πόσα είχε ο καθένας. Συμπεράν από την ερώτηση, η μητέρα της Μπρέντα έφτιαξε 14 μπισκότα για 2 καλεσμένους, οι οποίοι είχαν τον ίδιο αριθμό μπισκότων πόσα είχαν οι καλεσμένοι.
